import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { createEvent } from "../actions/eventActions";

export default function CreateEventScreen() {
  const dispatch = useDispatch();
  const { loading, error, success } = useSelector((s) => s.eventCreate || {});

  const [form, setForm] = useState({ title: "", description: "", start_datetime: "", location: "", capacity: 0, featured: false });
  const [poster, setPoster] = useState(null);
  const change = (e) => setForm({ ...form, [e.target.name]: e.target.type === "checkbox" ? e.target.checked : e.target.value });
  const submit = (e) => {
    e.preventDefault();
    const fd = new FormData();
    Object.entries(form).forEach(([k, v]) => fd.append(k, v));
    if (poster) fd.append("poster", poster);
    dispatch(createEvent(fd));
  };

  return (
    <div className="row justify-content-center">
      <div className="col-md-8">
        <h3>Create Event</h3>
        {error && <div className="alert alert-danger">{String(error)}</div>}
        {success && <div className="alert alert-success">Event created!</div>}
        <form onSubmit={submit}>
          <div className="mb-3"><label className="form-label">Title</label><input name="title" className="form-control" value={form.title} onChange={change} required /></div>
          <div className="mb-3"><label className="form-label">Description</label><textarea name="description" className="form-control" value={form.description} onChange={change} required /></div>
          <div className="mb-3"><label className="form-label">Start Date/Time</label><input name="start_datetime" type="datetime-local" className="form-control" value={form.start_datetime} onChange={change} required /></div>
          <div className="mb-3"><label className="form-label">Location</label><input name="location" className="form-control" value={form.location} onChange={change} required /></div>
          <div className="mb-3"><label className="form-label">Capacity</label><input name="capacity" type="number" min="0" className="form-control" value={form.capacity} onChange={change} required /></div>
          <div className="mb-3"><label className="form-label">Poster</label><input type="file" className="form-control" onChange={(e) => setPoster(e.target.files[0])} /></div>
          <div className="form-check mb-3"><input id="featured" name="featured" type="checkbox" className="form-check-input" checked={form.featured} onChange={change} /><label htmlFor="featured" className="form-check-label">Featured</label></div>
          <button className="btn btn-primary" type="submit" disabled={loading}>Create</button>
        </form>
      </div>
    </div>
  );
}
